// SPDX-License-Identifier: MIT
pragma solidity >=0.4.21 <0.7.0;

// pragma experimental ABIEncoderV2;

contract SingleModelStorage {
    // string public model;

    uint len;

    function set(uint x) public {
        // model = strConcat(model, new_model);
        len = x;
    }

    function get() public view returns (uint) {
        return len;
    }

    function getLen() public view returns (uint) {
        return len;
    }

    function strConcat(string memory s1, string memory s2)
        public
        pure
        returns (string memory)
    {
        bytes memory byte_s1 = bytes(s1);
        bytes memory byte_s2 = bytes(s2);

        string memory concat_str = new string(byte_s1.length + byte_s2.length);

        bytes memory bytes_concat_str = bytes(concat_str);

        uint256 k = 0;

        for (uint256 i = 0; i < byte_s1.length; i++) {
            bytes_concat_str[k++] = byte_s1[i];
        }

        for (uint256 i = 0; i < byte_s2.length; i++) {
            bytes_concat_str[k++] = byte_s2[i];
        }

        return string(bytes_concat_str);
    }
}
